  \"2013-03-16T00:16:59.268481\",\n\t\"name\": \"geology-of-the-fall-zone-in-delaware-1972\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Report of investigations on the complex
  geologic framework of the Fall Zone in Delaware and its implications for ground
  water. The complex geologic framework of the Fall Zone in Delaware is primarily
  caused by diverse structural features present in the crystalline basement rocks
  that have exerted a considerable influence on the distribution of the overlying
  sediments of the Coastal Plain. A lateral fault and three different sets of vertical
  faults were recognized in the crystalline basement complex. The vertical faults
  have broken the surface of the basement complex into horst-graben structures. Although
  these faults were probably formed before the deposition of the Potomac Formation
  (Lower Cretaceous), there are indications that they are still active. This resource
  is available online at the Delaware Geological Survey. For more information and
  downloadable files please see links provided or visit the Delaware Geological Survey
  web page at \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
